import React from "react";
import "./App.scss";

function App() {
  return (
    <div className="container">
      <div className="nav">
        <ul>
          <li>Milk</li>
          <li>Bread</li>
          <li>Chocolate</li>
          <li>More chocolate</li>
        </ul>
      </div>
    </div>
  );
}

export default App;
